import React from 'react';
import { Button, Col, Container, Image, Row } from 'react-bootstrap';
import { publicUrl } from '../index';

const HomePage = () => {
  return (
    <Container className="d-flex flex-column align-items-center justify-content-center h-100 min-vh-100" maxWidth={1200}>
      <Row className="justify-content-end w-100">
        {/* Sun icon code here */}
      </Row>
      <Row className="align-items-center justify-content-center text-center w-100">
        <Col xs="auto">
          <Image src={`${publicUrl}/cyberbrainLogo.png`} width={350} height={350} />
          <h1 className="my-4">Cyberbrain</h1>
          <svg width="100%" height="100%" viewBox="0 0 1000 1000" className="position-absolute">
            <line x1="500" y1="200" x2="500" y2="600" stroke="#ffffff" strokeWidth="3" />
            <line x1="400" y1="400" x2="600" y2="400" stroke="#ffffff" strokeWidth="3" />
            <line x1="400" y1="500" x2="600" y2="500" stroke="#ffffff" strokeWidth="3" />
            <line x1="400" y1="600" x2="600" y2="600" stroke="#ffffff" strokeWidth="3" />
            <line x1="400" y1="700" x2="600" y2="700" stroke="#ffffff" strokeWidth="3" />
            <circle cx="400" cy="400" r="6" fill="#ffffff" />
            <circle cx="400" cy="500" r="6" fill="#ffffff" />
            <circle cx="400" cy="600" r="6" fill="#ffffff" />
            <circle cx="400" cy="700" r="6" fill="#ffffff" />
            <circle cx="600" cy="400" r="6" fill="#ffffff" />
            <circle cx="600" cy="500" r="6" fill="#ffffff" />
            <circle cx="600" cy="600" r="6" fill="#ffffff" />
            <circle cx="600" cy="700" r="6" fill="#ffffff" />
          </svg>
        </Col>
      </Row>
      <Row className="w-100">
        <Col xs="auto" className="text-center w-100">
          {/* Page buttons code here */}
        </Col>
      </Row>
    </Container>
  );
};

export default HomePage;
